Text:
@acaiijawe 'Tis called 'Pavlov's Classical Conditioning'.

Kerbau zaman sekarang pun masih boleh dididik sebegitu, asalkan cerebral cortex kerbau tersebut masih berhubung dan dlm keadaan baik.

Samalah dgn binatang di zoo atau circus yg boleh dididik utk melakukan sesuatu mengikut arahan.

Translated Text:
@acaiijawe 'Tis called 'Pavlov's Classical Conditioning'.

Today's buffalo can still be educated like that, as long as the buffalo's cerebral cortex is still connected and in good condition.

It's like an animal in a zoo or circus that can be trained to do something according to instructions.

