Text:
@mrKingrayz Macam harta lain, biasanya kita yang tetapkan Haul (cut of date) kita tuan.

Sebab susah nak kira Haul banyak jenis harta berbeza. Kita akan lost track bila ada pelbagai jenis harta dan pelbagai entry point.

Contoh lebih dari 30 harta. Kena ingat 30 haul berbeza.

Translated Text:
@mrKingrayz Like other property, we usually set the Haul (cut of date) sir.

Because it is difficult to calculate Haul of many different types of property. We will lose track when there are various types of property and various entry points.

Examples of more than 30 properties. Have to remember 30 different hauls.

Text:
@ChasingSan Tiada masalah tuan. Sebab hanya nilai pegangan kita pada akhir Haul sahaja yang perlu dikira.

Sebab kita nak keluarkan Zakat Harta. Harta kekayaan semasa kita pada tahun itu.

Transaksi jual-beli sepanjang tahun belum menggambarkan kekayaan kita pada tahun tersebut.

Translated Text:
@ChasingSan No problem sir. Because only the value of our holding at the end of Haul only needs to be calculated.

Because we want to pay Zakat Harta. Our current wealth that year.

The buying and selling transactions throughout the year have not reflected our wealth that year.

Text:
@bennkamal Haul = Tempoh setahun
Nisab = 85 gram emas = RM19,610 (Institusi zakat tetapkan berdasarkan harga purata emas. Berubah setiap 6 bulan)

Lepas kedua-dua syarat ini baru zakat dikeluarkan tuan.

Translated Text:
@bennkamal Haul = One year duration
Nisab = 85 grams of gold = RM19,610 (Zakat institutions set based on the average price of gold. Changes every 6 months)

After these two conditions, only zakat is released sir.

Text:
@Kristian_Kho @faizwahab Hampir semua fatwa-fatwa negeri tentang HARUS zakat untuk crypto dikeluarkan pada tahun 2020 ke atas. Sebelum itu, memang fatwa bagitau Haram.

Hukum ni sifatnya berkembang. Perbahasan fatwa sentiasa berlaku.

Sama macam ASB yang tidak patuh syariah dan sekarang telah diharuskan.

Translated Text:
@Kristian_Kho @faizwahab Almost all state fatwas about zakat for crypto MUST be issued in 2020 and above. Before that, it was a fatwa that said it was Haram.

The nature of this law is to develop. Fatwa debates are always happening.

Just like ASB that does not comply with Sharia and now it has been required.

Text:
@mnfmz Haul (tempoh setahun) ni kita yang tentukan.

Contoh kita tetapkan 31 Disember setiap tahun. Maka bila sampai tarikh tu (cukup haul), kita kira semua harta kita (simpanan, saham, emas dll) untuk keluarkan zakat.

Jika ada crypto boleh kira sekali untuk zakat tahun tersebut.

Translated Text:
@mnfmz Haul (year period) is what we decide.

For example we set December 31 every year. So when we reach that date (enough haul), we count all our wealth (savings, stocks, gold, etc.) to pay zakat.

If there is crypto, it can be counted once for the year's zakat.

