Kalau takut ambil risiko, at least letak duit kat pelaburan amanah (ASB, PRS), Tabung Haji dsb untuk beat inflasi.

Pelaburan lain, kena ada ilmu dulu.

Translated Text:
@BatmanLegoDC If you realize earlier to invest better. Cars are the best, until you don't realize you spend too much money on them.

If you are afraid to take risks, at least put money in trust investments (ASB, PRS), Tabung Haji etc. to beat inflation.

Other investments, you have to have knowledge first.

